    false,nt"url": null,nt"notes": "This annual narrative report for Ohio Islands
    National Wildlife Refuge outlines Refuge accomplishments during the 1993 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning and compliance with environmental and cultural resource mandates.
    Refuge administration is outlined; information about personnel, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, pest control, and water rights. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, and scientific collections. The
    public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about equipment
    replacement, communication systems, and computer systems. Items of interest are
    provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
